INSERT INTO `contents` (`id`, `menu_id`, `ctitle`, `carticle`, `updated_at`, `created_at`) VALUES
(1, 1, 'about our Company', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum', '2019-05-22 00:00:00', '2019-05-15 00:00:00'),
(2, 1, 'about me', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.', '2019-05-21 00:00:00', '2019-05-15 00:00:00'),
(3, 2, 'about our products', 'There are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable. If you are going to use a passage of Lorem Ipsum, you need to be sure there isn\'t anything embarrassing hidden in the middle of text. All the Lorem Ipsum generators on the Internet tend to repeat predefined chunks as necessary, making this the first true generator on the Internet. It uses a dictionary of over 200 Latin words, combined with a handful of model sentence structures, to generate Lorem Ipsum which looks reasonable. The generated Lorem Ipsum is therefore always free from repetition, injected humour, or non-characteristic words etc.', '2019-06-13 13:06:52', '2019-05-15 00:00:00');
INSERT INTO `contents` (`id`, `menu_id`, `ctitle`, `carticle`, `updated_at`, `created_at`) VALUES
(4, 1, 'about my Company', '<p style=\"text-align: left;\"><span style=\"font-family: Impact;\">﻿<span style=\"font-family: &quot;Comic Sans MS&quot;;\">this company starts in <span style=\"background-color: rgb(255, 0, 0);\">2012</span>.</span></span></p><p style=\"text-align: left;\"><font face=\"Comic Sans MS\">after <b>many years</b> working in a&nbsp; <u>big company</u>&nbsp;,i open&nbsp;my own and ,</font></p><p style=\"text-align: justify;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">I start to work for my self.</span></p><p style=\"text-align: left;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">I fixed many Computers ,and all the Time did my best.</span></p><p style=\"text-align: left;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\">and already have hundreds of clients all over TLV.</span></p><p style=\"text-align: left;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\"><br></span></p><p style=\"text-align: left;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"ב3.jpg\" style=\"width: 50%; float: right;\" class=\"note-float-right\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\"><br></span></p><p style=\"text-align: left;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\"><br></span></p><p style=\"text-align: left;\"><span style=\"font-family: &quot;Comic Sans MS&quot;;\"><br></span><span style=\"font-family: Impact;\"><br></span><br></p>', '2019-06-13 10:48:09', '2019-06-13 10:48:09');
